import addData from "./dbCon";
import Layout from "../components/layout";

const Mock = () => (
  <Layout>
    <h1 style={{ color: "white" }}>Deneme</h1>
    <input type="text" placeholder="Blog Name" id="inputName" />
    <button
      className="submit"
      onClick={e => addData(document.getElementById("inputName").value)}
    >
      Submit
    </button>
    <input type="text" placeholder="Blog Detail" id="inputDetail" />
    <button
      className="submit"
      onClick={e => addData(document.getElementById("inputDetail").value)}
    >
      Submit
    </button>
    <p style={{ color: "red" }} hidden>Blank input!</p>
  </Layout>
);

export default Mock;
